  useEffect(() => {
    const fetchData = async () => {
      const result = await axios("http://localhost:8000/coins");
      console.log(result.data);
      setData(result.data);
    };

    fetchData();
  }, []);
  return (
    <div>coinFeed</div>
  )
}

